import React, { useEffect } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import {
  Container,
  Typography,
  CircularProgress,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableRow,
  Paper,
  Box,
  useMediaQuery,
  Card,
  CardContent,
  TableHead,
} from '@mui/material';
import { GetWishlist } from '../redux/actions/productActions';
import EmptyCart from '../assets/image/emptycart.png';
import { SecondaryButton } from '../Global/Button/MuiButton';
import { useNavigate } from 'react-router-dom';

const Wishlist = () => {
  const dispatch = useDispatch();
  const navigate = useNavigate();
  const { loading, wishlists, error } = useSelector((state) => state.wishlist) || {};
  const isMobile = useMediaQuery('(max-width:767px)');
  console.log('wishlist....ðŸ‘‰', wishlists);

  const user = JSON.parse(localStorage.getItem('user'));
  const userId = user?._id;

  useEffect(() => {
    if (userId) {
      dispatch(GetWishlist(userId));
    }
  }, [dispatch, userId]);

  return (
    <Container>
      <Box sx={{ m: 2 }}>
        {loading && <CircularProgress />}
        {error && <Typography color="error">{error}</Typography>}

        {wishlists?.items?.length > 0 ? (
          <>
            {isMobile ? (
              wishlists.items.map((item) => (
                <Card
                  key={item.productId?._id}
                  sx={{
                    display: 'flex',
                    mb: 2,
                    boxShadow: 2,
                    borderRadius: 2,
                    p: 1,
                  }}
                >
                  <img
                    src={item.productId?.ProductImage || EmptyCart}
                    alt={item.productId?.name || "No Image"}
                    style={{
                      height: '80px',
                      width: '80px',
                      borderRadius: '10px',
                      marginTop: '25px',
                    }}
                  />
                  <CardContent sx={{ flex: 1, p: 1 }}>
                    <Box sx={{ display: 'flex', justifyContent: 'space-between' }}>
                      <Typography variant="body1">
                        {item.productId?.name || "Unknown Product"}
                      </Typography>
                    </Box>
                    <Box sx={{ display: 'flex', justifyContent: 'space-between' }}>
                      <Typography variant="body2">Price:</Typography>
                      <Typography>â‚¹{item.productId?.price || 0}</Typography>
                    </Box>
                  </CardContent>
                </Card>
              ))
            ) : (
              <TableContainer component={Paper} sx={{ overflowX: 'auto', borderRadius: 2, boxShadow: 3 }}>
                <Table>
                  <TableHead>
                    <TableRow>
                      <TableCell></TableCell>
                      <TableCell>Product</TableCell>
                      <TableCell align="right">Price</TableCell>
                    </TableRow>
                  </TableHead>
                  <TableBody>
                    {wishlists.items.map((item) => (
                      <TableRow key={item.productId?._id}>
                        <TableCell>
                          <img
                            src={item.productId?.ProductImage || EmptyCart}
                            alt={item.productId?.name || "No Image"}
                            style={{ height: '80px', width: '80px', borderRadius: '10px' }}
                          />
                        </TableCell>
                        <TableCell>
                          <Typography fontWeight="bold">{item.productId?.name || "Unknown Product"}</Typography>
                        </TableCell>
                        <TableCell align="right">â‚¹{item.productId?.price || 0}</TableCell>
                      </TableRow>
                    ))}
                  </TableBody>
                </Table>
              </TableContainer>
            )}
          </>
        ) : (
          <Box sx={{ display: 'flex', flexDirection: 'column', alignItems: 'center', m: 2 }}>
            <img src={EmptyCart} alt="Empty Cart" style={{ width: '100px', height: '100px' }} />
            <Typography sx={{ fontSize: 20, fontWeight: 500, my: 1 }}>
              Your wishlist is empty.
            </Typography>
            <SecondaryButton text="START SHOPPING" onClick={() => navigate('/collection')} />
          </Box>
        )}
      </Box>
    </Container>
  );
};

export default Wishlist;
